import React from "react";
import {Redirect} from "react-router-dom";
export default function Novel(props){
    return(
        <div>
            <Redirect from={"/novel/" + props.novel.id} to={"/novel/" + props.novel.id + "/" + props.novel.name.replace(/ /gi, "_")}/>
            <p>
                {props.novel.name}
            </p>
            <p>
                {props.novel.desc}
            </p>
        </div>
    )
}
